import React from 'react';
import Event from './components/Event/index.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Event title={'The Good Event'} address={'2700 Lincoln Way'} attendees={365}/>
      </header>
    </div>
  );
}

export default App;
